import React from 'react';
// import PropTypes from 'prop-types';
import Messages from './Message'

const MessagesList = ({ messages }) => (
    <section id="message-list">
        <ul>
            {messages.map(message => (
                <Messages  
                    key={message.id}
                    {...message}
                />
            ))}
        </ul>
    </section>
);

